import React from 'react'
import { loginRequest } from '../../AuthenticationFolder/authConfig'
import { callForEvent } from './GraphCalls';
import { useState } from 'react';

export async function GetEvent (data, instance, accounts){
    var eventArr = [];
    const request = {
        ...loginRequest,
        account: accounts[0]
    };  
    instance.acquireTokenSilent(request).then((res) => {
      eventArr = data.map((user) => {
            callForEvent(res.accessToken, user.userPrincipalName, user.accountEnabled)
        })
    })
    return eventArr;
}
